import React from "react";

function Login() {
  return (
    <div className="page">
      <h1>Login / Register</h1>
      <p>Sign in to manage your tickets, track results, and top up your wallet.</p>
      <p>New to Zottry? Create an account to start playing instantly.</p>
    </div>
  );
}

export default Login;
